import React from "react";
import IITILOGO from "./images/iitilogo.png";
import "./left.css";

export default function Left() {
     let secondleft= document.querySelector(".secondleft");
   const hide =()=>{secondleft.style.width = "8.5rem"?secondleft.style.width = "0rem":secondleft.style.width = "8.5rem";
    secondleft.style.overflow = "hidden";
    secondleft.style.transition = "width 0.5s ease-in-out";
    secondleft.style.fontSize = "0rem";
    secondleft.style.backgroundColor = "rgb(165, 216, 220)";
    secondleft.style.position = "relative";
    secondleft.style.zIndex = "1";
   } 

  return (

    <> 
      <div className="left d-flex">
        <div className="firstleft d-flex">
          <a href="/" onClick={hide} className="top">
            <i className="fa-solid fa-angles-left"></i>
          </a>

          <a href="/" className="mx-8">
            <i className="fa-solid fa-qrcode"></i>
          </a>
          <a href="/">
            <i className="fa-regular fa-user"></i>
          </a>
          <a href="/">
            <i className="fa-regular fa-user"></i>
          </a>
          <a href="/">
            <i className="fa-solid fa-table-cells"></i>
          </a>
           <a href="/">
             <a href="/">
            <i className="fa-solid fa-square-poll-horizontal"></i>
          </a>
          </a>
        </div>
        <div className="secondleft d-flex">
          <a href="/"  onClick={hide} className="top">Hide</a>
          <a href="/">Dashboard</a>
          <a href="/">Profile</a>
          <a href="/">Enroll</a>
          <a href="/">TimeTable</a>
           <a href="/">Polls</a>
          <div className="logo">
            <img src={IITILOGO} alt="logo" />
          </div>
        </div>
      </div>
    </>
  );
  }
